import React from "react";
import { Section, StyledTitle, StyledImg, Caption } from "./styles";
import { TitleSize } from "../../ui/title/title";
import newsPhoto from "../../../assets/news.jpg"

function News() {
    return (
        <Section>
            <StyledTitle size={TitleSize.MEDIUM}>Новости</StyledTitle>
            <StyledImg src={newsPhoto}></StyledImg>
            <Caption>Победитель регаты шкипер Иван Кулешов</Caption>
            <StyledTitle size={TitleSize.SMALL}>Итоги регаты Sochi Race Week 2020</StyledTitle>
        </Section>
    )
}

export default News;
